import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar } from 'react-bootstrap';

function Nav() {
  return (
    <Navbar className='navbar-expand-lg navbar-dark bg-primary'>
      <Link to='/saved'>
      <Nav.Link>
        My Library
      </Nav.Link>
      </Link>

      <a className='navbar-brand' href='/'>
       Search
      </a>
    </Navbar>
  );
}

export default Nav;
